import React from 'react';
import { NavLink } from 'react-router-dom';
import { RoutesConfig } from '../config/routes.config';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { ReactComponent as ReactSeoLogoSvg } from '../assets/img/ReactSeoLogo.svg';
import styled from 'styled-components';
import Card from 'react-bootstrap/Card';
import CustomLegend from '../containers/Home/components/CustomLegend'

const Sticky = styled.div`
&&& {
  position: -webkit-sticky; /* Safari */
  position: sticky;
  top: 10%;
  right: 10%;
  height: 400px;
  width: 400px;
}`

const SideBar: React.FC = () => (
  <Sticky>
    <Card style ={{padding:"1em"}}>
    <div id="toc_container">
      <p>Page contents</p>
      <ul>
      <li><a href="#What is my audience?">1 What is my audience?</a></li>
        <li><a href="#Who are my followers?">2 Who are my followers?</a>
        <ul>
          <li><a href="#r_bubbles">2.1 Researchers</a></li>
          <li><a href="#p_bubbles">2.2 Practitioners</a></li>
          <li><a href="#o_bubbles">2.3 Other publics</a></li>
        </ul>
      </li>
      <li><a href="#Who are my tweets reaching?">3 Who are my tweets reaching?</a></li>
      <li><a href="#What is my audience talking about?">4 What is my audience talking about</a></li>
      <ul>
          <li><a href="#hashtags">4.1 Trending hashtags</a></li>
          <li><a href="#top_tweets">4.2 Top tweets</a></li>
        </ul>
     </ul>
     <CustomLegend />
    </div>
    </Card>
</Sticky>
);

export default SideBar;
